      <text id="39" justification="0" size="4" underlined="false">
        <text>Sample is a data class composed of elements.
We could go nuts and have, for example a QualityControlSample,
that inherits from this and has its own methods for calcs but I think
this would be overkill. We can just have excel do the calculations.</text>
      </text>
      <color id="40">
        <red>255</red>
        <green>228</green>
        <blue>181</blue>
        <alpha>255</alpha>
      </color>
    </NoteNode>
    <NoteNode id="41">
      <children id="42"/>
      <location class="Point2D.Double" id="43" x="100.0" y="500.0"/>
      <id id="44" value="1a862ae0-5423-4ccb-806f-942296f33472"/>
      <revision>1</revision>
      <backgroundColor reference="23"/>
      <borderColor reference="24"/>
      <textColor reference="24"/>
      <text id="45" justification="0" size="4" underlined="false">
        <text>The DataLoader aggragates samples and will be responsible
for loading the data into the workbook and formatting it in Load.
The ExcelPackage is created outside of this class and passed in
because I think it will be easier for having other classes that modify
the workbook (like a grapher or something.)
 
The Add&lt;blank&gt; functions are to be called by the DataLoaderParser
in Parse().</text>
      </text>
      <color id="46">
        <red>255</red>
        <green>228</green>
        <blue>181</blue>
        <alpha>255</alpha>
      </color>
    </NoteNode>
    <NoteNode id="47">
      <children id="48"/>
      <location class="Point2D.Double" id="49" x="860.0" y="770.0"/>
      <id id="50" value="4d374fee-6862-4440-ac6f-a2de72c4bbc3"/>
      <revision>1</revision>
      <backgroundColor reference="23"/>
      <borderColor reference="24"/>
      <textColor reference="24"/>
      <text id="51" justification="0" size="4" underlined="false">
        <text>DataLoaderParser handles the parsing of the input text file.
Parse should read the three sections that make up a Sample
(Sample Header, Results, Internal Standards.) It should create
a sample based off of the header then create and add elements to the
sample from the results. Finally the sample should be added to 
the loader based on the sample type.</text>
      </text>
      <color reference="40"/>
    </NoteNode>
